import './Footer.css'

function Footer(props) {
    return(
        <footer>
            <p>
                SMART CONTACT ADDRESS:&nbsp;
                <br />
                <span>
                    <a className='contact-link'>
                        {props.address}
                    </a>
                </span>
            </p>
        </footer>
    )
}

export default Footer;
